import ProfilePic from "../images/profile_pic.png";

const About = () => (
  <div className="about">
    <div className="picture--container">
      <a href="https://github.com/wc356">
        <div className="img--container">
          <img src={ProfilePic} alt="profile picture" />
        </div>
      </a>
    </div>
    <div className="about--description"></div>
    <style jsx>
      {`
        .about {
          padding: 200px;
        }

        .picture--container {
          border: 3px blue solid;
          overflow-x: hidden;
          overflow-y: hidden;
        }

        .img--container {
          cursor: pointer;
          display: block;
          overflow-x: hidden;
          overflow-y: hidden;
          position: relative;
          height: 400px;
          width: 600px;
        }

        img {
          vertical-align: middle;
          position: absolute;
          object-fit: cover;
          object-position: 50% 50%;
          max-width: 100%;
          width: 300px;
          height: 300px;
        }
      `}
    </style>
  </div>
);

export default About;
